class Solution {
    public int numSub(String s) {
        long count = 0;
        for (int i = 0; i < s.length(); i++) {
            if (s.charAt(i) == '1') {
                int j = i + 1;
                long len = 1;
                for (; j < s.length(); j++) {
                    if (s.charAt(j) == '0')
                        break;
                    len++;
                }
                count = (count + ((len * (len + 1) / 2) % 1000000007)) % 1000000007;
                i = j;
            }
        }
        return (int) count;
    }
}
